window.bookSummaryJSON = "<p>Ada has found her Prince Charming with Huxley but . . . she misses what she had with Noah.</p> <p>She feels incomplete and knows deep in her heart she is in love with him. She is just confused and so new to all of this that she is just as clueless as he is.</p> <p>When Lexi and Ada go on a special trip, one that was just for them and their mates, they find Saint and Noah have followed them.</p> <p>Things get awkward, but it gives Ada time to think about what she really wants and if she can ever forgive Saint.</p> <p>Summer, college, and boys . . . and the question on everyone's mind.</p> <p>Who is Zayn?</p>"; 
